import "./JoinUs.css";

const JoinUs = () => {
  return (
    <div className="join-us">
      <div className="left-join">
        <div>
          <span>ready to</span>
          <span className="text-stroke">level up</span>
        </div>
        <div>
          <span>your body</span>
          <span className="text-stroke">with us</span>
        </div>
      </div>
      <div className="right-join"></div>
    </div>
  );
};

export default JoinUs;
